import { Component } from '@angular/core';

@Component({
  selector: 'app-header',
  templateUrl: './header.component.html',
  styleUrls: ['./header.component.css']
})
export class HeaderComponent {

}
<header class="sticky top-0 z-10 flex flex-row bg-white-50 shadow-md">
  <button class="md:hidden button"> <span class="sr-only">Menu
    </span>
    <svg id="menu" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke-width="1.5"
      stroke="currentColor" class="w-6 h-6 mx-auto">
      <path stroke-linecap="round" stroke-linejoin="round" d="M3.75 6.75h16.5M3.75 12h16.5m-16.5 5.25h16.5" />
    </svg>
  </button>
  <h1 class="heading"><a href="/home">
      <img src="./../../../../assets/logo.png" alt="Valley View Logo" class="mx-auto my-4">
      "A Lifestyle Change"</a></h1>
</header>
